import React, { Component } from 'react'  

import Carousel from 'react-bootstrap/Carousel'  

export class BootstrapCarousel extends Component {  
    render(){

        return(
            
            <Carousel>
  <Carousel.Item>
    <img
      className="d-block w-100"
      height="430px"
      src="data:image/jpeg;base64,"
      alt="Alpha Variant"
    />

    <Carousel.Caption>
      <h3>Alpha Variant</h3>
      <p>Symptoms for Alpha Variant</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="data:image/jpeg;base64,"
      alt="Second slide"
      height="430px"
    />

    <Carousel.Caption>
      <h3>Beta Variant</h3>
      <p>Symtoms for Covid Beta Variant</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="data:image/jpeg;base64,"
      alt="Third slide"
      height="430px"
    />

    <Carousel.Caption>
      <h3>Gamma Variant</h3>
      <p>Symtoms for Covid Variant</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
        )
    }
}
export default BootstrapCarousel